        string industry;
        string metadataURI;
        uint256 certifiedAt;
        uint256 expiryDate;
        bool isCertified;
        uint256 tokenId;
    }

    struct Enterprise {
        address enterpriseAddress;
        string name;
        string industry;
        string metadataURI;
        bool isRegistered;
        uint256 registrationDate;
        uint256 lastUpdated;
        uint256 certificateId;
    }

