        uint256 id;
        address targetEnterprise;
        uint256 inspectionId;
        address auditor;
        string reason;
        string evidenceURI;
        uint256 depositAmount;
        AuditStatus status;
        uint256 createdAt;
        uint256 resolvedAt;
    }

    enum AuditStatus {
        Pending,
        Upheld,
        Rejected,
        Appealed
    }
