contract Errors {
    error InvalidAddress();

    // -------- RolesManager ------------------//
    error RolesManager__UnauthorizedToPerformAction();
    error RolesManager__NotAuthorizedCertifier();
    error RolesManager__NotAuthorizedInspector();
